import * as React from 'react';
import Intervalo_de_confainza from './componentes/Home/intervalo-de-confianza';
import Inicio from './componentes/Home/inicio';
import './App.css';
import { NextUIProvider } from '@nextui-org/react';
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
function App() {
  sessionStorage.setItem('datos', JSON.stringify({}));
  return (
    <NextUIProvider>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Inicio/>} />
          <Route path="/intervalo-de-confianza" element={<Intervalo_de_confainza/>} />
        </Routes>
      </BrowserRouter>
    </NextUIProvider>

  );
}

export default App;
